const var_abi = $var.oracle_abi
const bytecode = var_abi.bytecode
const abi = var_abi.abi


const provider = new ethers.providers.JsonRpcProvider($var.eoas_1.providerUri);
const signer = new ethers.Wallet($var.eoas_1.private_key, provider);

const factory = new ethers.ContractFactory(abi, bytecode, signer)

// gasprice = ethers.utils.parseUnits($var.eoas_1.minGasPrice, "gwei");
const linkAddress = $var.eoas_1.linkAddress

let contract;
if (!parseInt($var.eoas_1.minGasPrice)){
  contract = await factory.deploy(linkAddress);
} else{
  const gasprice = ethers.utils.parseUnits($var.eoas_1.minGasPrice, "gwei");
  contract = await factory.deploy(linkAddress, {gasPrice: gasprice});
}
await contract.deployTransaction.wait()

let add_authorized_node;

if (!parseInt($var.eoas_1.minGasPrice)){
  add_authorized_node = await contract.setFulfillmentPermission($var.eoas_1.address, true)
}
else{
  const gasprice = ethers.utils.parseUnits($var.eoas_1.minGasPrice, "gwei");
  add_authorized_node = await contract.setFulfillmentPermission($var.eoas_1.address, true, {gasPrice: gasprice})
}

await add_authorized_node.wait()

return contract.address

